  input: 'TEXT,F3XA,,"Re: Letter dated April 15, 2005 from FED analyst Ed Ryan.            When
    we submitted the previous report for this period, the election type  selected
    was OTHER for both candidates Dan Boren for Congress and Russ Carnahan for Congress
    Committee. The letter we received from our Campaign Finance Analyst stated that
    we chose GENERAL for both of these candiates in August 2004 and October 2004 which
    is not correct per our filings. Our printed report shows that we chose OTHER as
    the Election Type and viewing the report on the Internet just shows the Purpose
    of Disbursement as CONTRIBUTION. It doens''t indicate the Election Type at all.
    In order to correct the report, our analyst said to amended the report by typing
    in Primary Debt in the Purpose of Disbursement field.                                                              From
    original memo entry:  Line 11(a)(ii) - itemized contributions - no single source
    contribution more than $200 in  this total.       Line 15 - Offsets of operating
    expenditures - Alan B. Lubin - original DNC Delegate check for $3000 was issued
